// SPDX-License-Identifier: MIT
pragma solidity >=0.5 <0.9.0;
import "./hts-precompile/IHederaTokenService.sol";
import "./hts-precompile/HederaResponseCodes.sol";
import "./hts-precompile/KeyHelper.sol";
import "./hts-precompile/ExpiryHelper.sol";
import "./Factory.sol";
import "hardhat/console.sol";

contract MyContract is HederaTokenService, KeyHelper {
    uint256 data;
    event SetData(uint256 _value);
    int64 MULTIPLIER = 1000000;
    int32 NUM_DECIMALS = 6;
    Factory factory;
    uint[] first;
    string[] second;
    event Array(uint[] first, string[] second);
    event MyValue(uint value, uint ethervalue);

    constructor() {
        //factory = new Factory();
    }

    function callFactory() external payable {
        address(factory).delegatecall(
            abi.encodeWithSignature("myCreateToken(address)", address(this))
        );
        //factory.myCreateToken{value: msg.value}(address(this));
    }

    function showMessage() public payable {
        require(msg.value >= 10, "Insufficient payment");
        console.log("Yest");
        emit MyValue(msg.value, 1 ether);
        first.push(1);
    }

    function emitEvent() external {
        first.push(1);
        first.push(2);
        second.push("Hello");
        second.push("world");
        emit Array(first, second);
    }

    function myCreateToken() public payable {
        IHederaTokenService.TokenKey[]
            memory keys = new IHederaTokenService.TokenKey[](0);

        IHederaTokenService.Expiry memory expiry = IHederaTokenService.Expiry(
            0,
            address(this),
            8000000
        );

        IHederaTokenService.HederaToken memory token = IHederaTokenService
            .HederaToken(
                "SmartContractToken",
                "SCT",
                address(this),
                "",
                true,
                10000000,
                false,
                keys,
                expiry
            );

        (int responseCode, ) = HederaTokenService.createFungibleToken(
            token,
            10000000,
            NUM_DECIMALS
        );

        require(responseCode == HederaResponseCodes.SUCCESS);
    }

    function myAssociateToken(address token) external {
        int responseCode = HederaTokenService.associateToken(msg.sender, token);
        if (
            responseCode != HederaResponseCodes.SUCCESS &&
            responseCode !=
            HederaResponseCodes.TOKEN_ALREADY_ASSOCIATED_TO_ACCOUNT
        ) {
            revert();
        }
    }

    function myTransferToken(address token, address to, int64 amount) external {
        int responseCode = HederaTokenService.transferToken(
            token,
            msg.sender,
            to,
            int64(amount)
        );
        require(
            responseCode == HederaResponseCodes.SUCCESS,
            "Failed to transfer token"
        );
    }

    function getData() external view returns (uint256) {
        return data;
    }

    function setData(uint256 _data) external {
        data = _data;
        emit SetData(_data);
    }

    function setDataPrivate(uint256 _data) private {
        data = _data + 10;
    }

    function recoverSignerFromSignature(
        uint8 v,
        bytes32 r,
        bytes32 s,
        bytes32 hash
    ) public pure returns (address) {
        address signer = ecrecover(hash, v, r, s);
        return signer;
    }

    event Deployed(address addr, uint256 salt);

    function deploy(bytes memory code, uint256 salt) public {
        address addr;
        assembly {
            addr := create2(0, add(code, 0x20), mload(code), salt)
            if iszero(extcodesize(addr)) {
                revert(0, 0)
            }
        }

        emit Deployed(addr, salt);
    }
}
